import React from 'react';
import './App.css';
import FormatListNumberedIcon from '@material-ui/icons/FormatListNumbered';
import TrendingUpIcon from '@material-ui/icons/TrendingUp';
import SettingsIcon from '@material-ui/icons/Settings';
import TimerIcon from '@material-ui/icons/Timer';
import Header from './components/Header.js';
import Kaartje from './components/HomepageCards.js';
import KaartjeOefening from './components/MeCards.js';

import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';

import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';


import { BrowserRouter as Router, Switch, Route, NavLink}from 'react-router-dom';


function App() {

  const [value, setValue] = React.useState(2);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  // Or Create your Own theme:
const theme = createMuiTheme({
  palette: {
    secondary: {
      main: '#23985F'
    }
  }
});


  return (
    <div className="App">
      <Header />

      <Router>
        <Switch>
          <Route exact path="/home">
            <Kaartje />
          </Route>
          <Route exact path="/me">
            <Paper square>
              <MuiThemeProvider theme={theme}>
                <Tabs
                  value={value}
                  indicatorColor="secondary"
                  textColor="primary"
                  onChange={handleChange}
                  aria-label="disabled tabs example"
                  className="tabs"
                >
                  <NavLink to="/home" activeClassName="activeLink" className="bottomnavitem"><Tab label="chest" className="tab" /></NavLink>
                  <Tab label="bicep" className="tab" />
                  <Tab label="tricep" className="tab" />
                  <Tab label="back" className="tab" />
                </Tabs>
              </MuiThemeProvider>
            </Paper><br></br>
            <KaartjeOefening />
          </Route>
          <Route exact path="/progress">
            Progress
            blablalba
          </Route>
          <Route exact path="/settings">
            Settings
          </Route>
        </Switch>

        <footer>
          <NavLink to="/home" activeClassName="activeLink" className="bottomnavitem"><TimerIcon /></NavLink>
          <NavLink to="/me" activeClassName="activeLink" className="bottomnavitem"><FormatListNumberedIcon /></NavLink>
          <NavLink to="/progress" activeClassName="activeLink" className="bottomnavitem"><TrendingUpIcon /></NavLink>
          <NavLink to="/settings" activeClassName="activeLink" className="bottomnavitem"><SettingsIcon /></NavLink>
        </footer>
      </Router>

    </div>
  );
}

export default App;
